import React from 'react';
import './Body.css'

export default function Item(props){
  return(
      <div className= "item">
        <h4 className = "itemtext">{props.Item}: ${props.Price}</h4>
        <div className = 'btns'>
            <button className="pos">+</button>
            <button className = "count">{props.count}</button>
            <button className="neg">-</button>
        </div>
      </div>
  )
}
